   "source": [
    "tensorflow::set_random_seed(12345,disable_gpu = F)\n",
    "\n",
    "imgShap <- c(300,300)\n",
    "imagePrep <- function(x) {\n",
    "  arrays <- lapply(x, function(path) {\n",
    "    img <- image_load(path, target_size = imgShap, \n",
    "                      grayscale = FALSE\n",
    "                      )\n",
    "    \n",
    "    x <- image_to_array(img)\n",
    "    x <- array_reshape(x, c(1, dim(x)))\n",
    "    x <- x/255 # rescale image pixel\n",
    "  })\n",
    "  do.call(abind::abind, c(arrays, list(along = 1)))\n",
    "}\n",
    "\n",
    "testX <- imagePrep(valData$file_name)\n",
    "\n",
    "# Check dimension of testing data set\n",
    "dim(testX)\n",
    "\n",
    "\n",
    "decode <- function(x){\n",
    "  case_when(x == 0 ~ \"akiec\",\n",
    "            x == 1 ~ \"bcc\",\n",
    "            x == 2 ~ \"bkl\",\n",
    "            x == 3 ~ \"df\",\n",
    "          x == 4 ~ \"mel\",\n",
    "            x == 5 ~ \"nv\",\n",
    "            x == 6 ~ \"vasc\"\n",
    "            )\n",
    "}\n",
    "\n",
    "\n",
    " #predTest <- predict_classes(model, testX) # this has been removed in tensorflor from 2.6 onwards \n",
    "\n",
    "predTest <- predict(model, testX) %>% k_argmax()\n",
    "\n",
    "\n",
    "predTestLet <- sapply(predTest, decode) \n",
    "\n",
    "head(predTestLet, 10)\n",
    "\n",
    "set.seed(5000)\n",
    "confusionMatrix(as.factor(predTestLet), \n",
    "                as.factor(valData$class)\n",
    "                )\n",
    "\n",
    "modPred <- predict(model,testX)\n"
   ]
  },
